const INPUT: &'static str = "



";

// const INPUT: &'static str = "ULL
// RRDDD
// LURDL
// UUUUD";

const GRID: &'static str = "  1   234 56789 ABC   D  ";

fn main() {
  fn g(x: i32, y: i32) -> char {
    let n = y * 5 + x;
    if n < 0 || n >= 25 { return ' ' }
    GRID.chars().nth(n as usize).unwrap()
  }

  let mut x: i32 = 0;
  let mut y: i32 = 2;

  for line in INPUT.lines() {
    for command in line.chars() {
      let (dx, dy) = match command {
        'U' => (0, -1),
        'D' => (0, 1),
        'L' => (-1, 0),
        'R' => (1, 0),
        _ => unreachable!(),
      };

      let (nx, ny) = (x + dx, y + dy);
      if g(nx, ny) != ' ' {
        // println!("{}", command);
        x = nx;
        y = ny;
      } else {
        // println!("{} fail", command);
      }
    }

    print!("{}", g(x, y));
  }
  println!("");
}
